import { motion } from 'framer-motion';

const cricketBatIcon = () => {
  return (
    <motion.div
      initial={{ y: 0, scale: 1 }}
      animate={{
        y: [0, -20, 100, 80], // anticipation and follow-through
        scale: [1, 0.9, 0.8, 0.9], // scale down and up
      }}
      transition={{ duration: 0.5, ease: 'easeInOut' }}
    >
      {/* Cricket bat icon SVG or image */}
    </motion.div>
  );
};
